import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
        this.state = { body: 'default' };
    }
    handleClick(e) {
        this.setState({body: e});
    }
    createButtons = (text) => {
        let buttons = []
        for (let i = 0; i < text.length; i++) {
            let b = text[i].label
            buttons.push(<button key={b} onClick={() => this.handleClick(b)}>{b}</button>)
        }
        return buttons
    }
    render() {
        const buttonText = 
            [
                {
                    label: 'People',
                    header: 'Doctors, Nurses, Therapists; People'
                },
                {
                    label: 'Places',
                    header: 'Hospitals, Clinics, Locations'
                },
                {
                    label: 'Dates',
                    header: 'Appointments, Trips, Dates'
                }
            ]
        return (
            <div id="MainApp">
                <div className="Buttons">
                    {this.createButtons(buttonText)}
                </div>
                <Search />
                <Input />
                <Data />
            </div>
        );
    }
}

export default App;

const e = React.createElement;
class PeopleButton extends Component {
    constructor(props) {
        super(props);
        this.state = { people: false };
    }
    render() {
        if (this.state.people) {
            return 'Doctors page';
        }
        return e(
            'button',
            { onClick: () => this.setState({ people: true }) },
            'Doctors, Nurses, Staff'
        );
    }
}

class Search extends React.Component {
    render() {
        return <input type="text"></input>
    }
}
class Input extends React.Component {
    render() {
        return <input type="text"></input>
    }
}
